import React from 'react';

const About = () => {
  return (
    <div className="container">
      <section className="page-section">
        <h1 className="section-title">About Us</h1>
        <div className="section-content">
          <p>We are a leading construction company with a legacy of excellence in building and construction.</p>
          <p>Our team of experienced professionals is committed to delivering outstanding results for every project.</p>
          <p>With a focus on quality, safety, and innovation, we bring your vision to life.</p>
        </div>
      </section>
    </div>
  );
};

export default About;
